import React from 'react';
import logo from './logo.svg';
import './App.css';
import Search from './components/Search';

function App() {
  return (
    <>
      <nav>
        <select>
          <option>Admin</option>
          <option>Regular</option>
        </select>
      </nav>
      <div className="App-header">
        <Search />
      </div>
    </>
  );
}

export default App;
